import React, { Component } from 'react';
import './App.css';

import Todo from './components/todo';
import TodoList from './components/todoList';

class App extends Component {
  addTodo = () => {
    alert('added');
  };
  render() {
    return (
      <div>
        <div className='todo-container'>
          <Todo />
          <TodoList />
        </div>
      </div>
    );
  }
}

export default App;
